import box from '../assest/Group 33.png';


function Head() {
  return (
  <div className='hd'>
     <div className='imges'>
         <img alt='1' src={rock1} className='one'/>
         <img alt='2' src={rock2} className='2'/>
     </div>
     <div className='lego'>
